// Libs
import axios from 'axios';

export const API_URL = process.env.REACT_APP_SUPERHERO_API_URL;

// export const getAllPics = () => axios({
// 	url: `${API_URL}/photos?client_id=a972ebf867c33a917ea0b5268e20f344e64a6c8aed1eaabc01d5483d7dd2e9a3`,
// 	method: 'get',
// });

export const getAllHeros = () => axios({
	url: `${API_URL}/1`,
  method: 'get',
  headers: {
    'Content-Type': 'application/json',
    'Access-Control-Allow-Origin': '*',
	},
});
